from geopy.exc import GeocoderTimedOut

class SuperBowlDataGenerator:
    def __init__(self, num_games, num_cities, num_teams, output_file='super_bowl_data.csv'):
        self.num_games = num_games
        self.num_cities = num_cities
        self.num_teams = num_teams
        self.output_file = output_file

    def geocode_with_retry(self, geolocator, coordinates, max_retries=5):
        for attempt in range(max_retries):
            try:
                location = geolocator.reverse(coordinates, language='en')
                if location and 'address' in location.raw:
                    return location
            except GeocoderTimedOut:
                print(f"Geocoding attempt {attempt + 1} timed out. Retrying...")
        
        raise GeocoderTimedOut(f"Geocoding failed after {max_retries} attempts.")

