    def generate_super_bowl_data(self):
        teams = [f'Team{i}' for i in range(1, self.num_teams + 1)]
        cities = self.get_distinct_city_names()

        data = {'Date': [], 'Team1': [], 'Team2': [], 'City': [], 'Score1': [], 'Score2': []}

        for _ in range(self.num_games):
            date = datetime(2000, 1, 1) + timedelta(days=np.random.randint(0, 365*10))
            team1, team2 = np.random.choice(teams, size=2, replace=False)
            city = np.random.choice(cities)
            score1, score2 = np.random.randint(0, 50, size=2)

            data['Date'].append(date)
            data['Team1'].append(team1)
            data['Team2'].append(team2)
            data['City'].append(city)
            data['Score1'].append(score1)
            data['Score2'].append(score2)

        return pd.DataFrame(data)

    def generate_and_save_data(self):
        super_bowl_data = self.generate_super_bowl_data()
        super_bowl_data.to_csv(self.output_file, index=False)
        print(f"Generated {self.num_games} Super Bowl games data and saved to {self.output_file}.")

